import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return(
        <ContactsContainer>
            <h1>Contacts</h1>
            <img scr="iPhoneImage/iPhoneImage.svg" alt="iPhone-image"></img>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 80%;
    height: 100vh;
    margin: 0px auto;
`

export default Contacts
